import React, { useState } from "react";
import { Button, ButtonGroup, Col, Form, Row } from "react-bootstrap";
import { useNavigate } from "react-router-dom";
import { useAuthContext } from "../Hooks/useAuthContext";

function Login() {

    const { auth, setAuth } = useAuthContext();

    const navigate = useNavigate();

    const onClickCancel = (event: React.MouseEvent<HTMLButtonElement>) => {
    navigate("/MyApp");
    event.preventDefault();
  }; 
  return (
    <div className="form">
      <div className="form-body">
        <Form.Group className="mb-3" controlId="exampleForm.ControlInput1">
          <Form.Label>Login</Form.Label>
          <Form.Control size="lg" type="email" placeholder="name@example.com" />
        </Form.Group>

        <Form.Group className="mb-3" controlId="exampleForm.ControlInput1">
          <Form.Label  >Password</Form.Label>
          <Form.Control size="lg" type="password"  />
        </Form.Group>
        <div>{auth.login}</div>
        </div>
        {/* <div className="btn-group d-flex" role="group"> */}
        <Row>
        <Col className="btn-group d-flex"><Button variant="primary" size="lg" >
            Ok
        </Button></Col>
        <Col className="btn-group d-flex"><Button variant="primary" size="lg" onClick={onClickCancel}>
            Cancel
        </Button></Col>
        <Col className="btn-group d-flex"><Button variant="primary" size="lg">
            Register
        </Button></Col>
      </Row>
    </div>
  );
}

export default Login;
